import Header from "../components/Header";
import globalVars from "../library/globalVariables";
import axios from "axios";
import generateUniqueId from "generate-unique-id";
import stringMethods from "../library/stringMethods";
import useEffect from "react"

const Emails = ({ data }) => {

    useEffect(() => {
        const title = new stringMethods(router.pathname)
          .removeSlash()
          .firstCharUpperCase()
          .addStringToEnd(globalVars.titleSubText)
          .getString();
        document.title = title;
        setInitialized(true);
      });

  const tableBody = data.map(email => (
    <tr key={generateUniqueId()}>
      <td>{email.date}</td>
      <td>{email.to}</td>
      <td>{email.subject}</td>
      <td>{email.message}</td>
    </tr>
  ));

  const h1 = new stringMethods(router.pathname)
    .removeSlash()
    .firstCharUpperCase()
    .getString();

  return (
    <>
      <h1>{h1}</h1>
      <Header />
      <table>
        <thead>
          <tr>
            <td>Date and time</td>
            <td>To</td>
            <td>Subject</td>
            <td>Message</td>
          </tr>
        </thead>
        <tbody>{tableBody}</tbody>
      </table>
    </>
  );
};

Emails.getInitialProps = async () => {
  const res = await axios({
    method: "get",
    url: `${globalVars.serverURL}/emails`,
    responseType: "json"
  });
  const data = await res.data;
  return { data };
};

export default Emails;
